import React from 'react'

const Alert = (props) => {

    return (
        <div style={{ height: '4rem' }}>
            {props.alert && <div className={`alert alert-${props.alert.type}`} role="alert">
                {props.alert.msg}
            </div>}
        </div>
    )
}

export default Alert
